  true,\n\t\"url\": null,\n\t\"notes\": \"OPTIMAL PARTITIONS OF DATA IN HIGHER DIMENSIONSrnrnBRADLEY
  W. JACKSON*, JEFFREY D. SCARGLE**, AND CHRIS CUSANZA, DAVID BARNES, DENNISrnKANYGIN,
  RUSSELL SARMIENTO, SOWMYA SUBRAMANIAM, TZU-WANG CHUANG***rnrnAbstract. Consider
  piece-wise constant approximations to a function of several parameters, andrnthe
  problem of finding the best such approximation from measurements at a set of points
  in thernparameter space. We find good approximate solutions to this problem in two
  steps: (1) partitionrnthe parameter space into cells, one for each of the N data
  points, and (2) collect these cells intornblocks, such that within each block the
  function is constant to within measurement uncertainty.rnWe describe a branch-and-bound
  algorithm for finding the optimal partition into connected blocks,rnas well as an
  O(N2) dynamic programming algorithm that finds the exact global optimum over thisrnexponentially
  large search space, in a data space of any dimension. This second solution relaxesrnthe
  connectivity constraint, and requires additivity and convexity conditions on the
  block fitnessrnfunction, but in practice none of these items cause problems. From
  the wide variety of intelligentrndata understanding applications (including cluster
  analysis, classification, and anomaly detection)rnwe demonstrate two: partitioning
  of the State of California (2D) and the Universe (3D).\",\n\t\"license_title\":
